"use strict";function injectCSSFading(t){t.addEventListener("click",e=>{e.preventDefault(),e.stopPropagation(),document.querySelectorAll(".transition").forEach(t=>t.className+=" out");setTimeout(()=>{window.location=t.href},300)})}document.onreadystatechange=function(){"complete"===document.readyState&&document.querySelectorAll(".transition").forEach(t=>{injectCSSFading(t)})};
